var title_f14_16_14596="Early acromegalic arthropathy";
var content_f14_16_14596=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=RHEUM%2F64058%7ERHEUM%2F82074&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=RHEUM%2F64058%7ERHEUM%2F82074&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Acromegaly",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 292px; height: 324px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Plain film of the hand in a 53-year-old woman who presented with enlarged hands shows thickening of the soft tissues, exaggeration of the bony tufts of the distal phalanges, and prominence of the muscular attachments of the proximal phalanges. These are all features consistent with acromegaly.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Jonathan Kruskal, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Late acromegalic arthropathy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 407px; height: 288px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Plain film of the hands shows the changes in late acromegalic arthropathy. The abnormalities include tufting of the terminal phalanges, widening of the joint spaces of the metacarpophalangeal joints, and degenerative changes, seen particularly in the thumb and first carpometacarpal joints and in the proximal interphalangeal joint of the right little finger.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Verna Wright, MD, FRCP.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
