"        Given on days",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Paclitaxel",
"        </strong>",
"       </td>",
"       <td>",
"        135 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        IV",
"       </td>",
"       <td>",
